// start 变换位置，可以称为 target
// 每个 ‘L’ 在 target 中的下标小于等于对应的 ‘L’ 在 start 中的下标，以及每个 ‘R’ 在 target 中的下标大于等于对应的 ‘R’ 在 start 中的下标。
var canChange = function (start, target) {
  if (start.replace(/_/g, '') !== target.replace(/_/g, '')) return false
  for (let i = 0, j = 0; i < start.length; ) {
    while (start[i] === '_') {
      i++
    }
    while (target[j] === '_') {
      j++
    }
    // 用双指针从左向右遍历 start\textit{start}start 和 target\textit{target}target，分类讨论：
    // 如果当前字符为 L 且 i<ji<ji<j，由于 L 由于无法向右移动，返回 false；
    // 如果当前字符为 R 且 i>ji>ji>j，由于 R 由于无法向左移动，返回 false。
    if (i !== j && (start[i] === 'L') === i < j) return false
    i++
    j++
  }
  return true
}

